import React from 'react';
import Login from './auth/Login';
import Register from './auth/Register';
import Cart from './cart/Cart';
import Products from './products/Products';
import NotFound from './utiles/not_Found/NotFound';
import { BrowserRouter as Router, Route, Routes ,Switch } from 'react-router-dom'
function Pages() {
  return (
    <Switch>
    <Route path='/' exect component={Products}/>
    <Route path='/login' exect component={Login}/>
    <Route path='/register' exect component={Register}/>
    <Route path='/cart' exect component={Cart}/>

    <Route path='*' exect component={NotFound}/>

        
    
  </Switch>
  )
     
  
}

export default Pages;
